function click(){
fetch("https://www.themealdb.com/api/json/v1/1/search.php?s")
.then((response)=>response.json())
.then((datas)=>{
    console.log(datas);
    const food=[
        {
            meal:datas.meals[0].strMeal,
            mealImage:datas.meals[0].strMealThumb,
            mealProcess:datas.meals[0].strInstructions
        }
    ]
      
    
    setData(food)
  
 })
.catch((e)=>{
    console.log(e);
})}
useEffect(()=>{
click()

},[])

